import React from 'react';
import { Container, Row } from 'shards-react';
import FormCatalogue from '../../components/components-overview/FormCatalogue';
import PageTitle from "../../components/common/PageTitle";
import FormBuilder from '../../components/components-overview/ProgressFormBuilder';

export default function CreateProgressFlowIntakeForm() {
  return (
    <Container className="main-content-container px-4 pb-5">
    <Row noGutters className="page-header py-4">
      <PageTitle
        title="Progress Intake Form"
        subtitle="Dashboard"
        className="text-sm-left mb-3"
      />
    </Row>

      <FormCatalogue />    
      <FormBuilder />
    </Container>
  )
};
